import React, { Component } from 'react';
import { BRO, RouterProvider, Route } from 'react-router-dom';

import HomePage from './HomePage';
import  ProjectPage from './ProjectPage';


const home = createBrowserRouter([{

  path: "/",
  element : <HomePage/>

}])


const projetos = [<Route  path ="/projetos" Component = {ProjectPage}/>]



function App() {
  return (
    <React.StrictMode>
    <RouterProvider router={home} routes={projetos} ></RouterProvider>
    </React.StrictMode>
  );
}

export default App;
